import React, { useEffect, useState } from "react";
import { useHistory } from "react-router-dom";

const Maincard = () => {
  const [programs, setTodos] = useState([]);
  const history = useHistory();
  useEffect(() => {
    fetch(`https://api.tvmaze.com/shows`)
    .then(response=> response.json())
    
    .then(data=> setTodos(data) )
  }, []);

//console.log(todos);    
  return (

    <div>
        {programs.map((program)=>{
          const {image, name, id, genres} = program;
          const{medium} = image;
            return (
              <div key={id} onClick={() => history.push(`/${id}`)}>
                <img src= {medium} alt='see here for image'/>
                <h4>{name}</h4>
                <h6>{[genres.join(", ")]}</h6>
              </div>
            )
          })}
    </div>
    
  );
};
export default Maincard;
